class App extends Component{

constructor(){
super()
this.state = {

  type: '',
  date: moment().format('YYYY/MM/DD'),
  time: moment().format('HH:mm:ss'),
  username: '',
  socketId: '',

}

}

  return () {

    <Router>
    <div className ="container">
      <navigation />

      <br/>
      <Route path ="/" exact component={eventlog}/>
    </div>
    </Router>

  };




}




export default App;
